// import logo from './logo.svg';
import './App.css';
import { Dna } from 'react-loader-spinner';
import AnimatedText from 'react-animated-text-content';

function App() {
  return (
    <div className="App">
      <Dna
        visible={true}
        height="200"
        width="200"
        ariaLabel="dna-loading"
        wrapperStyle={{}}
        wrapperClass="dna-wrapper"
      />
      <AnimatedText
        type="words" // animate words or chars
        animation={{
          x: '200px',
          y: '-20px',
          scale: 1.1,
          ease: 'ease-in-out',
        }}
        animationType="float"
        interval={0.06}
        duration={0.8}
        tag="p"
        className="animated-paragraph"
        includeWhiteSpaces
        threshold={0.1}
        rootMargin="20%"
      >
        Content to animate
      </AnimatedText>;
    </div>
  );
}

export default App;
